import { Link, Typography, Grid } from "@material-ui/core";
import { makeStyles } from "@material-ui/core";
import card from "../image/card.jpeg";
import React from "react";
const useStyles = makeStyles((theme) => ({
  card: {
    // height: "100vh",
    padding: theme.spacing(1),
    textAlign: "center",
    alignItems: "center",
    [theme.breakpoints.up("md")]: {
      height: "100vh",
    },
  },
  card1: {
    width: "217px",
    minHeight: "230px",
    maxHeight: "250px",
    border: "1px solid",
    borderRadius: "10px",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    margin: "5px",
    [theme.breakpoints.down("xs")]: {
      width: "170px",
      minHeight: "200px",
      maxHeight: "200px",
    },
  },
  img1: {
    height: "120px",
    [theme.breakpoints.down("xs")]: {
      width: "150px",
    },
  },
  title1: {
    fontSize: "20px",
    paddingTop: "20px",
  },
  link: {
    textAlign: "center",
    color: "#000",
    "&:hover": {
      color: "blue",
    },
  },
}));

export default function ListCard() {
  const classes = useStyles();

  return (
    <Grid
      container
      justifyContent="center"
      spacing={2}
      className={classes.card}
    >
      <Grid className={classes.card1}>
        <Link
          href="http://www.google.com"
          className={classes.link}
          underline="none"
        >
          <img src={card} alt="img1" className={classes.img1} />
          <Typography className={classes.title1}>Thẻ bài</Typography>
        </Link>
      </Grid>
      <Grid className={classes.card1}>
        <Link
          href="http://www.google.com"
          className={classes.link}
          underline="none"
        >
          <img src={card} alt="img1" className={classes.img1} />
          <Typography className={classes.title1}>Thẻ bài</Typography>
        </Link>
      </Grid>
      <Grid className={classes.card1}>
        <Link
          href="http://www.google.com"
          className={classes.link}
          underline="none"
        >
          <img src={card} alt="img1" className={classes.img1} />
          <Typography className={classes.title1}>Thẻ bài</Typography>
        </Link>
      </Grid>
      <Grid className={classes.card1}>
        <img src={card} alt="img1" className={classes.img1} />
        <Typography className={classes.title1}>Thẻ bài</Typography>
      </Grid>
    </Grid>
  );
}
